import React from 'react'
import { Link } from 'react-router-dom'
export default function Signin() {
    return (
        <div>
            <h1>
                Login page
            </h1>
            <h3><Link to='/userdashboard'>User</Link></h3>
            <h3><Link to='/admindashboard'>Admin</Link></h3>
        </div>
    )
}
